    function loadNodes(dataToUse = null) {
        const data = dataToUse || nodeData;
        try {
                console.log('Loaded', data.length, 'nodes');
                // Update node count dynamically
                const nodeCountEl = document.getElementById('node-count');
                if (nodeCountEl) {
                    nodeCountEl.textContent = data.length;
                }
                // Calculate and update country count dynamically
                const countries = new Set(data.filter(n => n.country && n.country.trim()).map(n => n.country));
                const countryCountEl = document.getElementById('country-count');
                if (countryCountEl) {
                    countryCountEl.textContent = countries.size;
                }
                            const heatData = data.map(node => [node.latitude, node.longitude, 1]);
                if (heatmapLayer) {
                    map.removeLayer(heatmapLayer);
                }
                            if (typeof L.heatLayer !== 'undefined') {
                                heatmapLayer = L.heatLayer(heatData, {
                                    radius: 20,
                                    blur: 20,
                                    maxZoom: 18,
                                    gradient: {
                                        0.2: 'blue',
                                        0.4: 'cyan',
                                        0.6: 'lime',
                                        0.8: 'yellow',
                                        1.0: 'red'
                                    },
                                    minOpacity: 0.3
                    }).addTo(map);
                            }
                                markersLayer.clearLayers();
                                const nodesToShow = data.length <= 1000 ? data : data.slice(0, 1000);
                                nodesToShow.forEach(node => {
                                    const popupText = `
                                        <div style="font-family: monospace; font-size: 12px;">
                                            <b>📍 Node Information</b><hr style="margin: 5px 0;">
                                            <b>IP:</b> ${node.ip || 'N/A'}<br>
                                            <b>Port:</b> ${node.port || 'N/A'}<br>
                                            <b>Version:</b> ${node.version || 'N/A'}<br>
                                            <b>Country:</b> ${node.country || 'N/A'}<br>
                                            <b>City:</b> ${node.city || 'N/A'}<br>
                                            <b>User Agent:</b><br>
                                            <small>${(node.user_agent || 'N/A').substring(0, 60)}...</small>
                                        </div>
                                    `;
                                    L.circleMarker([node.latitude, node.longitude], {
                                        radius: 4,
                                        color: '#ff4444',
                                        fillColor: '#ff6666',
                                        fill: true,
                                        fillOpacity: 0.6,
                                        weight: 1
                                    }).bindPopup(popupText).addTo(markersLayer);
                                });
                                if (data.length > 1000) {
                                    console.log('Showing first 1000 markers for performance');
                                }
                const loader = document.getElementById('update-loader');
                const updateText = document.getElementById('update-text');
                if (loader) loader.classList.add('hidden');
                if (updateText) updateText.textContent = 'Data will be refetched after 10 seconds';
        } catch(error) {
            console.error('Error processing nodes:', error);
            const loader = document.getElementById('update-loader');
            const updateText = document.getElementById('update-text');
            if (loader) loader.classList.add('hidden');
            if (updateText) updateText.textContent = 'Data will be refetched after 10 seconds';
        }
    }
    // Don't load embedded data immediately - fetch from server first
    // loadNodes(); // Removed - will fetch from server first
    function tryUpdateFromFile() {
        fetch('bitcoin_nodes.json?t=' + new Date().getTime())
            .then(response => {
                if (!response.ok) throw new Error('Network response was not ok');
                return response.json();
            })
            .then(data => {
                console.log('✓ Updated from server:', data.length, 'nodes');
                loadNodes(data);
            })
            .catch(error => {
                console.log('Using embedded data (server fetch failed):', error.message);
                // Only use embedded data as last resort
                loadNodes();
            });
    }
    let eventSource = null;
    let sseConnected = false;
    function connectSSE() {
        try {
            eventSource = new EventSource('/events');
            eventSource.onopen = function() {
                sseConnected = true;
                console.log('✓ Connected to real-time update stream');
                const updateText = document.getElementById('update-text');
                if (updateText) updateText.textContent = 'Data will be refetched after 10 seconds';
            };
            eventSource.onmessage = function(event) {
                try {
                    const data = JSON.parse(event.data);
                    if (data.type === 'file_changed') {
                        console.log('✓ File change detected, updating map...');
                        tryUpdateFromFile();
                    }
                } catch (e) {
                    console.log('SSE message parse error:', e);
                }
            };
            eventSource.onerror = function(error) {
                if (!sseConnected) {
                    console.log('SSE connection failed, falling back to polling');
                    setInterval(tryUpdateFromFile, 10000);
                } else {
                    console.log('SSE connection lost, reconnecting...');
                    sseConnected = false;
                    setTimeout(connectSSE, 5000);
                }
            };
        } catch (e) {
            console.log('SSE not supported, using polling:', e);
            setInterval(tryUpdateFromFile, 10000);
        }
    }
    connectSSE();
    // Fetch immediately on page load
    tryUpdateFromFile();
    setTimeout(function() {
        map.invalidateSize();
    }, 100);
